INSERT INTO `about_section` (`about_id`, `about`, `piagam_pelanggan`, `logo_sekolah`, `lagu_sekolah`, `lagu_persekutuan`) VALUES
(1, '<span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\">Sekolah Menengah Kebangsaan Putrajaya Presint 16(1) terletak di Presint 16, Wilayah Persekutuan Putrajaya. Pada awalnya sekolah ini diberi nama SMK Putrajaya 3 kerana ia merupakan sekolah menengah ke-3 di Wilayah Persekutuan Putrajaya. Sekolah ini memulakan operasi pada tanggal 6 Januari 2003. Lokasi sekolah ini terletak di kawasan Pusat Pentadbiran Putrajaya. Keluasan SMK Putrajaya 3 ialah kira-kira 12.5 hektar dan mempunyai 6 blok utama iaitu Blok A (Blok Menara Jam), Blok B (Blok Pentadbiran), Blok C (Blok Bilik Darjah), Blok D (Bengkel), Blok E (Pavilion), Blok F (Dewan) dan Blok G (Surau).</span><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\">Pengetua pertama sekolah ini ialah Cik Rusnani bt Mohd Sirin yang mula menjalankan tugas pada 16 September 2003 hingga September 2005. Pengetua kedua yang bertugas di sekolah ini mulai 19 Ogos 2005 hingga 06 April 2015 ialah Tuan Haji Mohd Yusof bin Hassan. Tuan Hj. Mohd. Yusof b Hassan telah ditawarkan jawatan Pengarah Pejabat Pelajaran Wilayah Persekutuan Putrajaya mulai 16 Januari 2008 dan kembali semula ke sekolah ini pada 3 April 2008 dengan jawatan Pengetua Cemerlang DG 52 yang berkuatkuasa mulai 16 Feb 2008. Pengetua ketiga yang melaporkan diri pada 22 April 2015 ialah Encik Ab Aziz Bin Mamat.</span><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\">Pada tahun pertama beroperasi, sekolah ini hanya mempunyai 145 orang murid. Murid yang terlibat ialah murid Tingkatan satu (3 buah kelas) dan Tingkatan 2 (3 buah kelas). Murid-murid ini datangnya dari sekolah di sekitar Wilayah Persekutuan Putrajaya seperti dari SK Putrajaya 1 (SK Putrajaya Presint 8(1) dan SK Putrajaya 3 (SK Putrajaya Presint 16(1). Sekolah juga menerima murid yang berpindah mengikut keluarga yang baru berpindah ke Wilayah Persekutuan Putrajaya. Bilangan guru pada tahun tersebut adalah seramai 25 orang dan staf sokongan seramai 7 orang. Kelas tingkatan 4 bermula pada tahun 2004 dengan bilangan murid seramai 69 orang. Terdapat dua kelas sains dan teknologi dan satu kelas sastera. Bilangan kelas telah bertambah dari tahun ke tahun kerana pertambahan bilangan murid. Pada tahun 2010 terdapat 18 kelas Tingkatan 1 hingga Tingkatan 3 dan 12 kelas bagi Tingkatan 4 dan Tingkatan 5. Pada tahun 2017 bilangan keseluruhan kelas adalah sebanyak 33 buah kelas dengan bilangan murid berjumlah 854 orang dan bilangan guru 78 orang.</span><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\">Kelas Aliran Agama (KAA) diperkenalkan pada tahun 2010 kepada murid Tingkatan 1 dan kelas MPV (Pemprosesan Makanan) untuk murid Tingkatan 4. Murid sulung aliran agama ialah seramai 20 orang manakala kelas MPV seramai 22 orang. Pada masa sekarang, sekolah ini juga menawarkan kelas KAA untuk murid-murid tingkatan 4 dan tingkatan 5.</span><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\">Nama sekolah telah diubah secara rasmi kepada Sekolah Menengah Kebangsaan Putrajaya Presint 16(1) mulai 10 Oktober 2007 di bawah pentadbiran Pejabat Pelajaran Wilayah Persekutuan Putrajaya (PPWPP). Di bawah kepimpinan cemerlang Tn. Hj. Mohd Yusof bin Hassan dan kerjasama yang padu daripada semua pihak. Pada tahun 2015, sekolah ini telah dipilih bersama-sama 99 buah sekolah dari seluruh Malaysia yang terlibat dengan Program Sekolah Transormasi (PreSTasi) kohort 1 yang sekarang ini lebih dikenali sebagai TS25.</span><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><br open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\"><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" letter-spacing:=\"\" 0.2px;=\"\" text-align:=\"\" justify;\"=\"\">Diharapkan sekolah ini akan terus memacu kejayaan dalam pelbagai bidang dan mampu melonjakkan kecemerlangan sehingga ke peringkat dunia.</span>', 'Sekolah Menengah Kebangsaan Putrajaya Presint 16(1) menyediakan perkhidmatan terbaik berfokuskan perkembangan potensi murid yang dinamik dan holistik ke arah melahirkan sahsiah unggul dalam merealisasikan Falsafah Pendidikan Negara\r\n<br><br>\r\n<h4 class=\"title\">MURID</h4>\r\n\r\n Memastikan setiap murid mendapat peluang pendidikan dan layanan sama rata serta berkualiti. \r\n<br>\r\nMemastikan kemenjadian murid dari aspek kepimpinan, kerohanian dan sahsiah terpuji.\r\n<br>\r\nMemastikan murid mendapat kemahiran asas ICT setelah tamat persekolahan.\r\n<br>\r\nMewujudkan peluang yang luas untuk perkembangan bakat dan potensi murid dalam bidang kokurikulum.\r\n<br><br>\r\n <h4 class=\"title\">GURU DAN STAF</h4>\r\n\r\nMemastikan guru yang berkualiti dari segi peribadi, profesionalisme, pedagogi dan teknologi pendidikan ke arah mencapai kecemerlangan pendidikan abad ke - 21. \r\nMenjalankan tugas dengan berpandukan nilai dan etika dalam perkhidmatan awam dan Kementerian Pendidikan Malaysia.\r\n<br><br>\r\n<h4 class=\"title\">IBU BAPA DAN KOMUNITI</h4>\r\n\r\nMewujudkan jalinan dan jaringan kerjasama serta hubungan mesra antara guru, ibu bapa dan komuniti melalui Persatuan Ibu bapa dan Guru (PIBG).\r\n<br><br>\r\n<h4 class=\"title\">STAKEHOLDERS</h4>\r\n\r\nBerusaha dan memberi sokongan terhadap program Jabatan Pendidikan WP Putrajaya (JPWPP) dan Kementerian Pendidikan Malaysia (KPM).\r\n<br>\r\nSentiasa mematuhi dan akur terhadap tugas dan arahan JPWPP, KPM dan bertindak dalam masa yang ditetapkan.\r\nBerusahha meningkatkan imej sekolah sebagai SEKOLAH TRANSFORMASI dan SEKOLAH LESTARI STEM yang cemerlang dari kaca mata dunia pendidikan khasnya dan peringkat global amnya.', '<br>\r\n<h4 class=\"title\">WARNA BIRU</h4>\r\nKeharmonian dan perpaduan dalam kalangan warga sekolah serta antara sekolah dengan masyarakat setempat\r\n \r\n<br><br>\r\n<h4 class=\"title\">WARNA EMAS</h4>\r\nKemurnian matlamat dan hasil pendidikan yang ingin diperolehi oleh sekolah\r\n <br><br>\r\n<h4 class=\"title\">WARNA KUNING</h4>\r\nMasyarakat yang berdaulat di bawah naungan Yang Dipertuan Agong dan institusi Raja-raja\r\n <br><br>\r\n<h4 class=\"title\">WARNA HITAM</h4>\r\nKejelasan misi & visi yang ingin dicapai\r\n<br><br> \r\n<h4 class=\"title\">LOGO MSC</h4>\r\nPenggunaan teknologi (ICT) dalam proses pengajaran & pembelajaran\r\n <br><br>\r\n<h4 class=\"title\">4 HELAIAN BUKU</h4>\r\nJasmani, Emosi, Rohani, Intelek yang perlu dipupuk dan disuburkan.\r\n <br><br>\r\n<h4 class=\"title\">BUKU</h4>\r\nSekolah sebagai gedung ilmu pengetahuan\r\n <br><br>\r\n<h4 class=\"title\">2 PECAHAN BULATAN</h4>\r\nKerjasama, toleransi, persepakatan yang erat antara sekolah dan ibu bapa\r\n <br><br>\r\n<h4 class=\"title\">BULATAN</h4>\r\nPenyediaan & penghasilan pelajar untuk cabaran globalisasi\r\n <br><br>\r\n<h4 class=\"title\">BUMI</h4>\r\nPengaplikasian ilmu bagi menghasilkan teknologi untuk memakmurkan umat secara global', '<b>SEKOLAHKU TERCINTA</b>\r\n\r\n <br><br>\r\n\r\nSMK PP ENAM BELAS SATU\r\n<br><br>\r\nMEMBINA GENERASI ALAF BARU\r\n<br><br>\r\nBERDIRI MEGAH DISINARI CAHAYA\r\n<br><br>\r\nLAHIR INSAN BERILMU BERIMAN BERJAYA\r\n\r\n \r\n<br><br>\r\n<b>KORUS</b>\r\n\r\n <br><br>\r\n\r\nBERWAWASAN BERILMU BERBAKTI\r\n<br><br>\r\nITULAH TERAS UNGGUL PEGANGAN KAMI\r\n<br><br>\r\nMENJUNJUNG MEGAH ASPIRASI NEGARA\r\n<br><br>\r\nSETIA MEMBELA NUSA DAN BANGSA\r\n<br><br>\r\n \r\n\r\nSMK PP ENAM BELAS SATU\r\n<br><br>\r\nMEMBINA GENERASI ALAF BARU\r\n<br><br>\r\nWARGA BERSATU HATI BERSEMANGAT WAJA\r\n<br><br>\r\nMAJULAH SEKOLAH KU SEKOLAH TERCINTA', 'Lagu rasmi baru Wilayah Persekutuan ini dirasmikan oleh YAB Timbalan Perdana Menteri Malaysia, Tan Sri Muhyiddin Yassin pada 29 Januari 2011 sempena Majlis Pelancaran dan Perarakan Sambutan Hari Wilayah Persekutuan.<br><br><h4 class=\"title\">Lirik :</h4>Inilah wilayah bumi yang bertuah<br>Maju membangun dijulang megah<br>Aman sentosa di sepanjang masa<br>Teguh disemai sentiasa<br><br>Membara semangat setiap warganya<br>Cergas mindanya semangat waja<br>Pada wilayah ditumpah setia<br>Hormat hormati penuh mesra<br><br>Bersatulah Berbaktilah<br>Semua warga wilayah<br><br>Sayangilah Lindungilah<br>Sepenuh jiwa raga<br><br>Kita jaga keharmonian semua<br>Maju sejahtera<br>Wilayah Persekutuan');
