INSERT INTO `blog` (`blog_id`, `blog_category_id`, `title`, `image`, `description`, `blog`, `sort`, `liked`, `viewed`, `status`, `date`) VALUES
(13, 0, ' MAKLUMAN BERKAITAN KEPUTUSAN SIJIL PELAJARAN MALAYSIA (SPM) TAHUN 2020', '1634693040616f6fb046fe3.jpg', '<p style=\"text-align: left; margin-bottom: 10px; padding: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; outline-style: initial; outline-width: 0px; vertical-align: baseline;\"><font face=\"Tw Cen MT, sans-serif\"><span style=\"font-size: 17.3333px;\">Merujuk kepada pengumuman oleh Menteri Kanan Pendidikan Datuk Dr. Radzi Jidin, keputusan Sijil Pelajaran Malaysia (SPM) Tahun 2020 akan diumumkan pada 10 Jun 2021(Khamis). Oleh itu, pihak sekolah menyenaraikan prosedur yang perlu dilakukan oleh calon SPM yang terlibat untuk memastikan kelancaran proses semakan keputusan secara dalam talian dan melalui aplikasi SMS.</span></font><br></p>', NULL, 1, NULL, 0, 1, NULL),
(14, 0, 'MAJLIS PERASMIAN DAN PENYERAHAN PROJEK PEMBINAAN TAMBAHAN 35 BILIK DARJAH DAN PERUNTUKAN PENYELENGGA', '16347318036170071b031e0.jpg', '<p>Alhamdulillah dan terima kasih kepada YBhg. Datuk Radzi Jidin, Menteri Kanan Pendidikan dan KPM atas keprihatinan memberikan peruntukan sebanyak RM120,000 untuk SMK Putrajaya Presint 16(1) bagi penyelenggaraan sekolah, yang telah disampaikan kepada Pengetua dan wakil YDP PIBG.<br></p>', NULL, 2, NULL, 0, 1, NULL),
(15, 0, 'MAKLUMAN SIDANG MEDIA KHAS, MENTERI KANAN PENDIDIKAN MALAYSIA ', '163473258761700a2b513d7.jpg', '<p>Sidang media khas oleh Menteri Kanan Pendidikan Datuk Dr. Radzi Jidin telah diadakan pada hari Ahad (6 Jun 2021) pada jam 10 pagi. Maklumat berkaitan dengan sidang media khas tersebut boleh rujuk di sini<br></p>', NULL, 0, NULL, 0, 1, NULL);
