INSERT INTO `facilities` (`facilities_id`, `facilities`) VALUES
(0, '                                   	\r\n                                                                  	\r\n                               <blockquote style=\"text-align:justify\"><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Playroom for the Kids&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\"> In addition to the regular classrooms the school has a playroom for the\r\nNursery and KG students. The playroom is equipped with educational toys,\r\nlearning aids and audio-visual gadgets for effective teaching.<o:p></o:p></span></p><p style=\"margin: 11.25pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Canteen&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nfont-family:\" tahoma\",sans-serif;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-ansi-language:en-us;mso-fareast-language:en-us\"=\"\"> The school\r\ncanteen offers the students a choice of having clean, fresh and hygienic food\r\nat affordable prices.<o:p></o:p></span></p><p style=\"margin: 11.25pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Infirmary&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nfont-family:\" tahoma\",sans-serif;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-ansi-language:en-us;mso-fareast-language:en-us\"=\"\"> The school has\r\na room that is fully equipped to look after students taking ill suddenly and to\r\nhandle unforeseen medical requirements.&nbsp; &nbsp; &nbsp;<o:p></o:p></span></p><p style=\"margin: 11.25pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Curricular Activities&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\"> The school offers quite a wide variety of curricular activities that\r\ninclude indoor games, physical training, public speaking, quizzing, science\r\nprojects, community service projects and others. &nbsp;&nbsp;\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;<o:p></o:p></span></p><p style=\"margin: 11.25pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Computer Laboratory&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:\r\n14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:calibri;=\"\" mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\"> The school has air-conditioned computer laboratory that is equipped\r\nwith a pool of latest computers having access to Multimedia and Internet. The\r\nschool imparts computer education with the latest technology to enable the\r\nstudents keep pace with the international standards of computer education.\r\nExternal resources are also used to supplement the facilities available in-house.<o:p></o:p></span></p><p style=\"margin: 11.25pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Science Laboratories&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:\r\n14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:calibri;=\"\" mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\"> The school has separate laboratories for Physics, Chemistry and\r\nBiological Sciences that not only meet the standards set by different Boards of\r\neducation but are also fully equipped to fulfill all the requirements of the\r\nfaculty and the students. They help the students observe the experiments\r\nclosely to understand the various scientific phenomena and inculcate in them\r\ncreative inquisitiveness.</span></p><p style=\"margin: 11.25pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-size:\r\n14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:calibri;=\"\" mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\"><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:=\"\" en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\">Library&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:=\"\" en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\"> The school has got a\r\nlibrary that is well stocked with a wide range of titles. It is our honest\r\nendeavour to try and cultivate reading habits among the students.</span><br></p></blockquote>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n                                   \r\n                                   ');
