INSERT INTO `hem` (`hem_id`, `jawatankuasa_induk_hem`, `senarai_guru_tingkatan`) VALUES
(1, '                                   	\r\n                                                                  	\r\n                                                                  	\r\n                               <p><span style=\"font-weight: 700;\">Pengerusi</span>                                                   : Cg Kamaluddin bin Mohd Kassim (Pengetua)</p><p><span style=\"font-weight: 700;\">Naib Pengerusi</span>                                           : <span style=\"font-size: 15px;\">C</span><span style=\"font-size: 15px;\">g</span> Mazira binti Mohd Zain (PK HEM)</p><p>                                                                   : <span style=\"font-size: 15px;\">C</span><span style=\"font-size: 15px;\">g</span> Hasni binti Zakaria (PK Pentadbiran)</p><p>                                                                   : <span style=\"font-size: 15px;\">C</span><span style=\"font-size: 15px;\">g</span> Aznita binti Saari (PK Kokurikulum)</p><p><span style=\"font-weight: 700;\">Setiausaha  </span>                                               : <span style=\"font-size: 15px;\">C</span><span style=\"font-size: 15px;\">g</span> Datin Naimah binti Ismail</p><p><span style=\"font-weight: 700;\">Pen. Setiausaha</span>                                         : <span style=\"font-size: 15px;\">C</span><span style=\"font-size: 15px;\">g</span> Noormarina binti Abdullah</p><p><span style=\"font-weight: 700;\">Ahli jawatankuasa :</span></p><p><span style=\"font-weight: 700;\">JK Disiplin & Pengawas</span></p><p><span style=\"font-size: 15px;\">Ketua Guru Disiplin                                                 : Cg. Mohd Faizudin bin Abdullah Bokhari</span><br><span style=\"font-size: 15px;\">Pen. Ketua Disiplin                                                  : Cg. Rosli bin Mohd Nor</span><br><span style=\"font-size: 15px;\">Setiausaha                                                              : Cg. Zuraini binti Zaidin</span><br><span style=\"font-s