INSERT INTO `news_events` (`blog_id`, `blog_category_id`, `title`, `image`, `description`, `blog`, `sort`, `liked`, `viewed`, `status`, `date`) VALUES
(1, 0, 'Teachers\' Day ', '1.jpg', 'Sarvepalli Radhakrishnan listen (help. ... Radhakrishnan believed that \"teachers should be the best minds in the country\". Since 1962, his birthday is being celebrated in India as Teachers\' Day on 5 S', NULL, 0, NULL, 0, 1, '2017-09-05 20:43:13'),
(2, NULL, 'Educations Day ', '2.jpg', 'National Education Day is an annual observance in India to commemorate the birth anniversary of Maulana Abul Kalam Azad, the first education minister of independent India, who served from 15 August 1947 until 2 February 1958. National Education Day of India is celebrated on 11 November every year.', NULL, NULL, NULL, 0, 1, '2017-11-11 00:00:00'),
(3, NULL, 'Children\'s Day ', '3.jpg', 'Birthday of Pandit Jawaharlal Nehru is celebrated as Children\'s Day in India. India\'s first Prime Minister, Pandit Jawaharlal Nehru, was born on November 14. Apart from being known for his skills as a statesman, Nehru was also immensely fond of children. So, the Children\'s Day is dedicated to the children of India.', NULL, NULL, NULL, 0, 1, '2017-11-14 00:00:00'),
(4, 0, 'Annual Fete & Exhibition', '15129072505a2d21f23411f.jpg', '', NULL, 0, NULL, 0, 1, '2017-12-10 11:59:07');
