(7, 'Admission for Session 2018', 'Admission Form wil be available from Monday, October 16, 2017 between 10:00 A.M. and 02:00 P.M.', '150852344859ea3db891a11.jpg', 1, '2017-10-20 18:17:28'),
(10, 'ANNUAL SCHOOL FETE AND EXHIBITION 2017', 'Students, their Parents/Guardians are notified, hereby, that like the yesteryears, the Annual Fete and Exhibition of the school will be held this year on Sunday, December 3, 2017 inside the school premises from 10:00 A.M. to 03:00 P.M. You are cordially invited to be present at the venue on the occasion with relatives and friends to witness the events taking place. This annual event of the school has gained immense popularity over the years.', '', 1, '2017-12-02 07:08:09');
