INSERT INTO `school_structure` (`school_structure_id`, `structure`, `medium_of_instruction`, `timing`, `academic_year`, `girls_morning_session`, `uniform`) VALUES
(1, '                                   	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                               <blockquote><p style=\"text-align: justify; \"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:calibri;=\"\" mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us;mso-bidi-language:ar-sa\"=\"\">The Crescent School operates in two sessions,\r\nseparately for boys and girls. While the morning session is exclusively for the\r\ngirls, the afternoon session belongs to the boys only. Both the sessions have\r\nNursery, LKG, UKG and Classes from I to XII. Children aged 3 years plus are\r\nadmitted to Nursery, 4 years plus to LKG, 5 years plus to UKG and 6 years plus\r\nto Class I. Age for every higher class increases by 1 year successively, and the\r\ncut-off for&nbsp;the eligible age&nbsp;is&nbsp;October 31 of the current year.</span></p></blockquote>\r\n                                   \r\n                                   \r\n                                   \r\n                                   ', '<blockquote><p style=\"text-align: justify; \"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Tahoma&quot;,sans-serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">The medium of instruction of the school is\r\nEnglish with Hindi and Bengali as the main vernacular subjects. Equal\r\nimportance is attached to all the languages to ensure that the pupils imbibe\r\nsound knowledge in both their first language and second language, as they form\r\nthe very basis of effective communication. A third language is taught from\r\nclass IV to class VIII compulsorily and the pupils are allowed freedom to opt\r\nbetween Urdu, Hindi or Bengali.</span></p></blockquote>', '                                   	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                               <p>                                   	\r\n                                                                  	\r\n                               </p><div style=\"text-align: center;\"><table><tbody><tr><th style=\"text-align: left;\"><p><br></p><table class=\"table table-bordered\"><tbody><tr><td><font face=\"Helvetica\"><span style=\"text-align: center;\"><u><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px;\">CLASSES</span></u></span><br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\"><b><u><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:\" calibri\",sans-serif;=\"\" mso-ascii-theme-font:minor-latin;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;=\"\" mso-bidi-theme-font:minor-bidi;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us;mso-bidi-language:ar-sa\"=\"\">MORNING SESSION FOR GIRLS</span></u><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:\" calibri\",sans-serif;=\"\" mso-ascii-theme-font:minor-latin;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;=\"\" mso-bidi-theme-font:minor-bidi;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us;mso-bidi-language:ar-sa\"=\"\">&nbsp;</span></b><br></font></td><td><u style=\"font-size: 12pt; text-align: center; font-family: Helvetica; background-color: transparent;\">AFTERNOON SESSION FOR BOYS</u><br></td></tr><tr><td style=\"text-align: center;\"><font face=\"Helvetica\">Nursery, LKG<br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">7.45 AM TO 10.45 AM<br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">11.30 AM TO 2.30 PM<br></font></td></tr><tr><td style=\"text-align: center;\"><font face=\"Helvetica\">UKG</font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">7.45 AM TO 11.15 AM<br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">11.45\r\nAM TO 3.15 PM<br></font></td></tr><tr><td style=\"text-align: center;\"><font face=\"Helvetica\">I &amp; II</font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">7.45 AM TO 11.15 AM<br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">11.45 AM TO 3.15 PM<br></font></td></tr><tr><td style=\"text-align: center;\"><font face=\"Helvetica\">III\r\nto X<br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">7.15\r\nAM TO 11.40 AM<br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">12.15\r\nPM TO 4.40 PM<br></font></td></tr><tr><td style=\"text-align: center;\"><font face=\"Helvetica\">XI &amp; XII<br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">7.30\r\nAM TO 12.05 PM<br></font></td><td style=\"text-align: center;\"><font face=\"Helvetica\">12.15\r\nPM TO 4.40 PM</font></td></tr></tbody></table><p><br></p></th></tr></tbody></table></div>\r\n                                   \r\n                                   \r\n                                   \r\n                                   \r\n                                   \r\n                                   \r\n                                   \r\n                                   \r\n                                   \r\n                                   ', '                                   	\r\n                                                                  	\r\n                                                                  	\r\n                               <blockquote style=\"text-align:justify\"><p><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Tahoma&quot;,sans-serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">The school observes the calendar year\r\nfrom&nbsp;January to December&nbsp;as its academic year for class Nursery to\r\nclass X, going by the stipulation of the West Bengal Board of Secondary\r\nEducation. As for classes XI and XII, the session starts from the month of\r\nApril of a certain year and goes on up to the month of March of the following\r\nyear, going by the stipulation of the West Bengal Council of Higher Secondary\r\nEducation.</span></p></blockquote>\r\n                                   \r\n                                   \r\n                                   ', '                                   	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                               <blockquote style=\"text-align:justify\"><p><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Tahoma&quot;,sans-serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">In the age of equality, every child,\r\nirrespective of gender, has got equal right to education. With that in view and\r\nto encourage conservative parents to send their daughters to school for\r\neducation,&nbsp;The&nbsp;Crescent School&nbsp;had&nbsp;decided right at the\r\ninception to dedicate the morning session exclusively to the cause of the\r\ngirls. We believe&nbsp;that it is important&nbsp;to create just the right kind\r\nof environment in the school for the girl-students to learn, open up their\r\nthoughts and delve into the quest for knowledge, which&nbsp;in turn enables\r\nthem to discover their latent talents and to excel in the field of education\r\nand co-curricular activities. It is often said that a virtuous lady is a\r\nblessing to the society.&nbsp;The Crescent School&nbsp;helps the&nbsp;girls of\r\ntoday take small strides before they mature into virtuous ladies and start\r\ntaking giant leaps.</span></p></blockquote>\r\n                                   \r\n                                   \r\n                                   \r\n                                   ', '                                   	\r\n                               <blockquote><p></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><b><u><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nfont-family:\" tahoma\",sans-serif\"=\"\">UNIFORM â€“ CLASSES NURSERY TO X&nbsp; <o:p></o:p></span></u></b></p>\r\n\r\n<p style=\"margin: 11.25pt 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Boys&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nfont-family:\" tahoma\",sans-serif;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-ansi-language:en-us;mso-fareast-language:en-us\"=\"\"> White\r\nhalf/full sleeved bush shirt with the school logo embossed on the breast\r\npocket, &nbsp;peacock blue shorts or trousers with loops, blue school belt,\r\nblue school neck-tie, white socks and black leather shoes.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 11.25pt 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Girls&nbsp;:</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nfont-family:\" tahoma\",sans-serif;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-ansi-language:en-us;mso-fareast-language:en-us\"=\"\"> White\r\nhalf-sleeved front open shirt, peacock blue tunic with school logo embossed on\r\nthe left pocket, blue school neck-tie, white socks and black leather shoes.\r\nGirls aged 11 years and above may wear white salwar, peacock blue jumper, white\r\ndupatta, white socks and black leather shoes. The girls using hijab, will have\r\nto put on white hijabs with peacock blue borders only.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 11.25pt 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">During winter, sweater or blazer of navy blue colour should be used by\r\nthe boys and the girls.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif\"=\"\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><b><u><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nfont-family:\" tahoma\",sans-serif\"=\"\">UNIFORM â€“ CLASSES XI &amp; XII<o:p></o:p></span></u></b></p>\r\n\r\n<p style=\"margin: 11.25pt 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\" tahoma\",sans-serif;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">Boys :</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\r\n\" tahoma\",sans-serif;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-ansi-language:en-us;mso-fareast-language:en-us\"=\"\">&nbsp;Blue pin\r\nstriped half sleeved bush shirt with the school logo embossed on the breast\r\npocket, navy blue trousers with loops around the waist region, school belt,\r\nnavy blue and peacock blue striped neck tie, white socks and black leather\r\nshoes.</span></p><p style=\"margin: 11.25pt 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:&quot;Tahoma&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US\">Girls :</span></b><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\r\n&quot;Tahoma&quot;,sans-serif;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-ansi-language:EN-US;mso-fareast-language:EN-US\">&nbsp;Blue pin\r\nstriped half sleeved jumper with the school logo embossed on the breast region,\r\nnavy blue dupatta, navy blue salwar, white socks and black leather shoes. The\r\ngirls using hijabs must put on white hijabs with peacock borders on them, as\r\nsupplied by the school.<o:p></o:p></span></p><p style=\"margin: 11.25pt 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:\r\n\" tahoma\",sans-serif;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-ansi-language:en-us;mso-fareast-language:en-us\"=\"\">\r\n\r\n</span></p><p style=\"margin: 11.25pt 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;font-family:&quot;Tahoma&quot;,sans-serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US\">During winter, sweater or blazer of navy blue colour should be used by\r\nthe boys and the girls.<o:p></o:p></span></p></blockquote>                                   	\r\n                               \r\n                                   \r\n                                   ');
