INSERT INTO `syllabi_curricula` (`syllabi_curricula`, `syllabus`, `character_education`, `teaching_training`, `extra_curricular`, `school_houses`) VALUES
(1, '<blockquote><p style=\"text-align: justify; \"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Tahoma&quot;,sans-serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">The school has designed the course curricula for\r\ndifferent classes on the basis of the requirements as specified by the West\r\nBengal Board of Secondary Education, West Bengal Council for Higher Secondary\r\nEducation and other education bodies at the national level. The school further\r\nensures that such curricula meet the all-round developmental needs of the\r\nstudents that include academics, social, physical, emotional and ethical\r\nvalues.</span></p></blockquote>', '<blockquote><p style=\"text-align: justify; \"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Tahoma&quot;,sans-serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">Character building is the highest goal of\r\neducation. Morality and Values of life define the vision of people and inspire\r\ntheir dreams to accomplish a fulfilling life. As such, special care has been\r\ntaken at the time of preparing the school curricula to ensure that Morality and\r\nValues of life get proper emphasis. The school endeavours to instill in its\r\npupils certain essential virtues of life that are avowed by all the religious,\r\nphilosophical and cultural traditions. They are&nbsp;<b>wisdom, justice,\r\nobedience, abstinence, integrity, fortitude, love, positive attitude,\r\ngratitude, humility and hard work.</b></span></p></blockquote>', '                                   	\r\n                               <blockquote><p></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">At\r\nthe Nursery level, trained teachers impart training to ensure that development\r\nin children takes place in a healthy and natural way. To do that, it becomes\r\nimportant for us to ensure that school going habit grows in every child.\r\nKeeping that in view, we try and design innovative activities in class so that\r\nchildren get tempted to come to school regularly. That gives us the opportunity\r\nto help them learn how to conduct themselves in class, form good habits and\r\nspeak only when spoken to. They also learn the basics of community living by\r\neating together, playing and cooperating with each other to form habits of\r\norder, accuracy and obedience. Learning letters and numbers, rhyming Nursery\r\nRhymes together, playing games, listening to stories, learning handicrafts,\r\ndoing activities in groups and sense training complete the curriculum.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">At\r\nthe Kindergarten level, children are exposed to the three basic skills of\r\nlearning viz. listening, reading and writing. They are taught to read and write\r\nwords and sentences and also to do basic figure works.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">At\r\nthe Primary School level from class I to class IV, the children are introduced\r\nto a wider world of academic education, observation, experience, appreciations\r\nand a larger sphere of activities to gain knowledge through learning. This is\r\nwhere their learning curve initiates and therefore, sufficient care is taken to\r\nensure that training is imparted in a scientific manner to provide the children\r\nwith ample scope for initiative and enterprise on their part. Care is taken\r\nfurther to ensure that the curiosity is aroused in children continuously and\r\nthey are encouraged to ask questions. Such questions are answered in a systematic\r\nmanner entirely to their satisfaction. That helps them open up their thought\r\nprocess.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\"> <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">At\r\nthe Middle School level from class V to class VIII, the process of learning\r\nthrough experience and activity by way of contacts with the world of ideas,\r\nobjects and emotions is furthered. The lessons are planned in such a manner\r\nthat they lay adequate emphasis on formal studies, cultivating reading habits\r\nand developing the sense of involvement to enable them acquire an outlook and\r\nbent of mind oriented to clear, precise and creative thinking.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 14pt; font-family: Tahoma, sans-serif;\">At the Secondary\r\nSchool level i.e., class IX &amp; class X, special emphasis is laid on\r\npreparing the students for their first public examination. At the Higher\r\nSecondary School level, i.e., Class XI &amp; XII courses on Science and Commerce\r\nstreams are conducted. Core subjects for Science stream are Physics, Chemistry,\r\nMathematics and Biology; and for Commerce stream core subjects are Accountancy,\r\nBusiness Studies, Costing &amp; Taxation and Computer Applications. The\r\nsyllabus set by West Bengal Board of Secondary Education and West Bengal\r\nCouncil for Higher Secondary Education are followed meticulously for Madhyamik\r\nand Higher Secondary Examinations respectively, and also the methodology\r\nprescribed by the expert Committees of the Board and the Council are put into\r\npractice. Special care is taken at the Higher Secondary level to equip the\r\nstudents with knowledge required for competitive examinations in pursuit of\r\nhigher academics viz. Engineering, Medical Science, Juridical&nbsp;and\r\nAccountancy professions. Apart from that, the spirit of competitiveness is\r\ninculcated in the students, confidence is boosted and necessary skills are\r\nimparted, that are required to pursue studies at the Higher Secondary level and\r\nbeyond.</span></p></blockquote>\r\n                                   ', '<blockquote><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Tahoma&quot;,sans-serif\">Special\r\nemphasis is laid on attaining excellence in co-curricular and extra-curricular\r\nactivities. Value Education helps the pupils possess a good moral character.\r\nOpportunities towards developing special skills are provided to the pupils from\r\nthe very beginning by having Music, Art &amp; Craft, Computer and Physical\r\nEducation as different parts of co-curricular activities. Special arrangements\r\nare made for regular coaching in Table Tennis, Badminton, Cricket and Karate.\r\nPupils are encouraged to participate in various inter-school competitions held\r\non Painting, Quiz and other Sporting Events. In addition to that, annual events\r\nlike Sports, Exhibitions, Excursions, Picnics, etc., are organized by the\r\nschool.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Tahoma&quot;,sans-serif\">In\r\norder to promote learning through a process that is meaningful, interesting and\r\nthoroughly enjoyable, a Multimedia Projector (3M) is used. The pupils are\r\nexposed to a wide variety of programmes that are educative and entertainment\r\nbased, through the use of CDs and Digital Media.<o:p></o:p></span></p></blockquote>', '                                   	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                                                                  	\r\n                               <blockquote><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">The\r\nstudents are grouped under four Houses for the convenience of organizing\r\nintra-class first and then inter-house activities and competitions. Such Houses\r\nare shown below :</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b>&nbsp; &nbsp;&nbsp;<span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\r\n\" tahoma\",sans-serif;mso-fareast-font-family:tahoma\"=\"\">A.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\" times=\"\" new=\"\" roman\";\"=\"\">&nbsp; </span></span></span><span dir=\"LTR\" style=\"text-indent: -0.25in; text-indent: -0.25in;\"></span><span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">EINSTEIN</span></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;<span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">-&nbsp;&nbsp;&nbsp;\r\n&nbsp;Red House</span></span>&nbsp;&nbsp;&nbsp;&nbsp;</b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b>&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\r\n\" tahoma\",sans-serif;mso-fareast-font-family:tahoma\"=\"\">B.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\" times=\"\" new=\"\" roman\";\"=\"\">&nbsp; </span></span></span><span dir=\"LTR\" style=\"text-indent: -0.25in;\"></span><span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">TAGORE</span></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">-&nbsp;&nbsp;&nbsp;&nbsp;\r\nBlue House</span></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b>&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\r\n\" tahoma\",sans-serif;mso-fareast-font-family:tahoma\"=\"\">C.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\" times=\"\" new=\"\" roman\";\"=\"\">&nbsp; </span></span></span><span dir=\"LTR\" style=\"text-indent: -0.25in;\"></span><span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">LEONARDO</span></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"text-indent: -0.25in;\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%;font-family:\" tahoma\",sans-serif\"=\"\">-&nbsp;&nbsp;&nbsp;&nbsp;\r\nYellow House</span></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b>&nbsp; &nbsp; D.&nbsp;<span lang=\"EN-US\" style=\"font-size: 14pt; line-height: 115%; font-family: Tahoma, sans-serif;\">KHAYYAM</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span lang=\"EN-US\" style=\"font-size: 14pt; line-height: 115%; font-family: Tahoma, sans-serif;\">-&nbsp;&nbsp;&nbsp;&nbsp; Green House</span></b></p></blockquote>\r\n                                   \r\n                                   \r\n                                   \r\n                                   \r\n                                   ');
